import logo from './logo.svg';
import './App.css';
import AppNavbar from './Components/Nav';  // Correct import statement
import 'bootstrap/dist/css/bootstrap.min.css';
import {BrowserRouter, Route, Switch} from "react-router-dom"
import ER from './Pages/NotFound';


function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <AppNavbar></AppNavbar>
        <Switch>
          <Route exact path={"/login"} component={ER} />

        </Switch>
      </BrowserRouter>
    </div>
  );
}

export default App;
